  cntr++;
  MPI_Irecv(&sfield[N*(VOLUME+2*( LX*LY*LZ + T*LY*LZ + T*LX*LZ ) )], 1, spinor_z_slice_cont, g_nb_z_up, 95, g_cart_grid, &request[cntr]);
