  MPI_Irecv(&sfield[N*(VOLUME+2*(LX*LY*LZ + T*LY*LZ + T*LX*LZ) + T*LX*LY)], 1, spinor_z_slice_cont, g_nb_z_dn, 96, g_cart_grid, &request[cntr]);
  cntr++;

  MPI_Waitall(cntr, request, status);


  /* boundary edges */

