void fini_momentum_classes ( int **** p_class, int **p_nmem, int *p_num ) {

  if ( *p_nmem != NULL ) {
    free ( *p_nmem );
    *p_nmem = NULL;
  }

  if ( *p_class != NULL ) {
    for ( int i = 0; i < *p_num; i++ ) {
      fini_2level_itable ( &((*p_class)[i]) );
    }
    free ( *p_class );
    *p_class = NULL;
  }

}  // end of fini_momentum_classes

